import React from "react";
import { Card } from 'react-bootstrap'

function ProductDetails() {
  const obj = [{
    Name: "Google Pixel 6a",
    OS: "Android",
    Size: "6.7inch",
    Camera: "64MP",
    Price: 32000,
    ReleaseDate: "12-12-22",
  },
{Name: "Google Pixel 7a",
OS: "Android",
Size: "6.7inch",
Camera: "64MP",
Price: 38000,
ReleaseDate: "23-8-23"}];
  return (
    <div style={{ marginLeft: "5rem", marginTop: "5rem" }}>
        {
        obj.map((i)=>{
            return(
                <Card style={{ width: "16rem", borderRadius: "5px" }}>
        <Card.Img
          variant="top"
          src="https://www.industrialempathy.com/img/remote/ZiClJf-640w.avif"
        />
        <Card.Body style={{ flex: 1 }}>
          <Card.Title>{i.Name}</Card.Title>
          <Card.Text>
            OS: {i.OS}
            <br />
            Size: {i.Size}
            <br />
            Camera : {i.Camera}
            <br />
            ReleaseDate : {obj.ReleaseDate}
          </Card.Text>
        </Card.Body>
      </Card>
            )
        }
        )
}
    </div>
  );
}

export default ProductDetails;
